actionConfiguration.body:
()=>{
		let buildPayload = {};
		buildPayload = {
			"vesselId": Input_VesselID.text,
			"behaviour": EditBehaviours.selectedOptionValue,
			"start": (EditSince.text==""?null:EditSince.text),
			"end": (EditUntil.text==""?null:EditUntil.text)
		}
		storeValue("key_EditBehaviour_Payload",buildPayload)
		EditVesselBehaviour.run(
				//success	
				() => {storeValue("key_EditBehaviour_AddAPIFail","");JSObject1.GetVesselBehaviours();closeModal('ModalEdit')},
				//fail
				() => {showAlert("Something went wrong - Vessel Behaviour not updated"); storeValue("key_EditBehaviour_AddAPIFail", EditVesselBehaviour.data.message)}		
		)
	}

